import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip } from 'recharts';
import { PieChart, Pie } from 'recharts';
import Nav from "./Nav"
import styles from './Present.module.css'

function Present() {
  const data = [{ name: 'Page A', uv: 400, pv: 2400, amt: 2400 }, { name: 'Page B', uv: 800, pv: 2600, amt: 2200 }, { name: 'Page B', uv: 560, pv: 1200, amt: 2200 }];
  const data01 = [
    {
      "name": "Group A",
      "value": 400
    },
    {
      "name": "Group B",
      "value": 300
    },
    {
      "name": "Group C",
      "value": 300
    },
    {
      "name": "Group D",
      "value": 200
    },
    {
      "name": "Group E",
      "value": 278
    },
    {
      "name": "Group F",
      "value": 189
    }
  ];
  const [toggle, setToggle] = useState(true)

  return (
    <div>
      <Nav></Nav>
      <div className={styles.container}>
        {toggle === true ?
          <div className={styles.chart}>
            <PieChart width={730} height={250}>
              <Pie data={data01} dataKey="value" nameKey="name" cx="50%" cy="50%" outerRadius={50} fill="#8884d8" />
              <Pie data={data01} dataKey="value" nameKey="name" cx="50%" cy="50%" innerRadius={50} outerRadius={80} fill="#82ca9d" label />
            </PieChart>
          </div> :
          <div className={styles.chart}>
            <div>支出趨勢</div>
            <LineChart width={400} height={400} data={data}>
              <Line type="monotone" dataKey="pv" stroke="#8884d8" />
              <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
            </LineChart>
          </div>
        }
      </div>
    </div>
  );
}

export default Present;
